import React from "react";
import { useState, useEffect } from "react";
import { Link } from "react-router-dom";

function SidePosts() {
  const [getComent, setComents] = useState([]);
  useEffect(() => {
    fetch("https://jsonplaceholder.typicode.com/comments/")
      .then((res) => res.json())
      .then((data) => {
        setComents(data);
      });
  }, []);

  console.log(getComent);

  return (
    <div>
      <div>
        {getComent.map(
          (x) => (
            <Link to="/comment/:id">
              <div className="objectas">
                <div>{x.name}</div>
                <div>Id:{x.id}</div>
                <div>{x.email}</div>
                <div>PostIs : {x.postId}</div>
              </div>
            </Link>
          )
          // console.log(x)
        )}
      </div>
      <div>hello</div>
      HELLO
    </div>
  );
}

export default SidePosts;
